#include <bits/stdc++.h>
using namespace std;
#define faster() ios_base::sync_with_stdio(false);cin.tie();cout.tie();
#define matrix vector <vector<long long>>
#define MOD 1000000007
const long long big = 1e6;
vector <long long> res;
int n, cnt;
matrix a, check;

int Checking(int n) {
    int check = 0;
    while ( n > 0 )
    {
        int i = n % 10;
        if ( i % 2 == 0 ) check++;
        else check--;
        n /= 10;
    }
    if ( check == 0 ) return 0;
    else return 1;
}

int main() {
    faster();
    int n, count = 0;
    cin >> n;
    for (int i = pow(10,n-1); i < pow(10,n) ; i++)
    {
        if ( Checking(i) == 0 )
        {
            cout << i << " ";
            count++;
        }
        if ( count == 10 )
        {
            cout << endl;
            count = 0;
        }
    }
}

